import React from "react";

const PrayerGetComponent = ({ randomRequest }) => {
    return (
      <div className="currentrequest">
        {randomRequest && (
          <div className="blog-preview" key={randomRequest.id}>
            <h2>{randomRequest.name}</h2>
          </div>
        )}
      </div>
    );
  };
  
  export default PrayerGetComponent;
